import React from "react";
import Card from './Card';
const Service = () => {
   const img = "https://picsum.photos/id/1/500/400";
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Our services</h1>
      </div>
      <div className="container-fluid mb-5">
        <div className="row">
            <Card
            imgsrc={img}
            />
  
        </div>
      </div>
    </>
  );
};
export default Service;
